import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-embedding',
  template: `
    <div *ngIf="recipe">
      <h2>Embedding Recipe</h2>
      <pre><code>{{ recipe }}</code></pre>
    </div>
    <form>
      <label for="url">URL:</label>
      <input type="text" id="url" [(ngModel)]="url" name="url" required />
      <button (click)="getRecipe()">Get Recipe</button>
    </form>
  `,
  styleUrls: ['./embedding.component.css']
})
export class EmbeddingComponent {
  recipe: string;
  url: string;

  constructor(private http: HttpClient) {}

  getRecipe() {
    this.http.get(`https://api.feldrecipe.com/embed?url=${this.url}`)
      .subscribe((response: any) => {
        this.recipe = response['content'];
      });
  }
}
```

